  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Tule Lake National
  Wildlife Refuge outlines Refuge accomplishments from May through August of 1947.
  The report begins by summarizing the weather conditions, water conditions, and food
  and cover during this period. Wildlife- including migratory birds, upland game birds,
  big game animals, furbearers, predators, rodents, raptors, and fish- is also covered.
  The Refuge development and maintenance section discusses physical developments and
  plantings. The public relations section of the report describes recreational uses,
  Refuge visitors, and Refuge participation. Items of interest, N-R forms, and narrative
  reports on Clear Lake National Wildlife Refuge, Upper Klamath National Wildlife
  Refuge, and Lower Klamath National Wildlife Refuge are attached.\",\n\t\"license_title\":
